import { motion } from "framer-motion";

const AnimatedBackground = () => {
  return (
    <motion.div className="fixed inset-0 -z-10 overflow-hidden">
      <motion.div
        className="absolute w-200 h-200"
        style={{
          borderRadius: "50%",
        }}
        animate={{
          scale: [1, 1.5, 1],
          rotate: [0, 180, 360],
        }}
        transition={{
          duration: 10,
          repeat: Infinity,
          ease: "easeInOut",
        }}
      />
    </motion.div>
  );
};

export default AnimatedBackground;
